  \"ghrsst-level-2p-global-subskin-sea-surface-temperature-from-the-advanced-scanning-microwave-rad\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Advanced Microwave Scanning Radiometer
  (AMSR-E) was launched on 4 May 2002, aboard NASA's Aqua spacecraft. The National
  Space Development Agency of Japan (NASDA) provided AMSR-E to NASA as an indispensable
  part of Aqua's global hydrology mission. Over the oceans, AMSR-E is measuring a
  number of important geophysical parameters, including sea surface temperature (SST),
  wind speed, atmospheric water vapor, cloud water, and rain rate. A key feature of
  AMSR-E is its capability to see through clouds, thereby providing an uninterrupted
  view of global SST and surface wind fields. Remote Sensing Systems (RSS, or REMSS)
  is the provider of these SST data for the Group for High Resolution Sea Surface
  Temperature (GHRSST) Project, performs a detailed processing of AMSR-E instrument
  data in two stages. The first stage produces a near-real-time (NRT) product (identified
  by \"_rt_\" within the file name) which is made as available as soon as possible.
  This is generally within 3 hours of when the data are recorded. Although suitable
  for many timely uses the NRT products are not intended to be archive quality. \"Final\"
  data (currently identified by \"v7\" within the file name) are processed when RSS
  receives the atmospheric model National Center for Environmental Prediction (NCEP)
  Final Analysis (FNL) Operational Global Analysis. The NCEP wind directions are particularly
  useful for retrieving more accurate SSTs and wind speeds. This dataset adheres to
  the GHRSST Data Processing Specification (GDS) version 2 format specifications.\",\n\t\"license_title\":
